// App.js
import React, { useState } from "react";
import Visualizer from "./Visualizer";
import { dijkstra, bellmanFord, floydWarshall, johnson, generateGraph } from "./algorithms";

export default function App() {
  const [graphData, setGraphData] = useState(() => generateGraph());
  const [start, setStart] = useState("A");
  const [end, setEnd] = useState("G");
  const [algo, setAlgo] = useState("dijkstra");
  const [paths, setPaths] = useState({});
  const [result, setResult] = useState(null);

  function runSingle() {
    const g = graphData.graph;
    let res = { path: [], distance: Infinity };
    if (!g[start] || !g[end]) {
      alert("Start or end node invalid (must be A..O).");
      return;
    }
    if (algo === "dijkstra") res = dijkstra(g, start, end);
    else if (algo === "bellmanFord") res = bellmanFord(g, start, end);
    else if (algo === "floydWarshall") res = floydWarshall(g, start, end);
    else if (algo === "johnson") res = johnson(g, start, end);
    setResult(res);
    setPaths({ [algo]: res.path });
  }

  function runCompare() {
    const g = graphData.graph;
    const d = dijkstra(g, start, end);
    const b = bellmanFord(g, start, end);
    const f = floydWarshall(g, start, end);
    const j = johnson(g, start, end);
    setPaths({
      dijkstra: d.path,
      bellmanFord: b.path,
      floydWarshall: f.path,
      johnson: j.path,
    });
    setResult({ d, b, f, j });
  }

  function regen() {
    setGraphData(generateGraph());
    setPaths({});
    setResult(null);
  }

  return (
    <div style={{ padding: 20, minHeight: "100vh", background: "#0b1220", color: "white", fontFamily: "sans-serif" }}>
      <h1 style={{ color: "#FACC15" }}>✈️ Airplane Route Optimizer (fixed)</h1>

      <div style={{ display: "flex", gap: 8, marginTop: 12, alignItems: "center" }}>
        <label>
          Start:
          <input value={start} onChange={(e) => setStart(e.target.value.toUpperCase())} style={{ marginLeft: 6, width: 40 }} />
        </label>
        <label>
          End:
          <input value={end} onChange={(e) => setEnd(e.target.value.toUpperCase())} style={{ marginLeft: 6, width: 40 }} />
        </label>

        <select value={algo} onChange={(e) => setAlgo(e.target.value)} style={{ marginLeft: 8 }}>
          <option value="dijkstra">Dijkstra</option>
          <option value="bellmanFord">Bellman-Ford</option>
          <option value="floydWarshall">Floyd-Warshall</option>
          <option value="johnson">Johnson</option>
        </select>

        <button onClick={runSingle} style={{ marginLeft: 8, background: "#FACC15", border: "none", padding: "8px 12px", cursor: "pointer" }}>
          Run
        </button>

        <button onClick={runCompare} style={{ marginLeft: 6, background: "#60A5FA", border: "none", padding: "8px 12px", cursor: "pointer" }}>
          Compare All
        </button>

        <button onClick={regen} style={{ marginLeft: 6, background: "#34D399", border: "none", padding: "8px 12px", cursor: "pointer" }}>
          New Random Map
        </button>
      </div>

      <div style={{ marginTop: 20 }}>
        <Visualizer graphData={graphData} paths={paths} />
      </div>

      {result && (
        <div style={{ marginTop: 14, color: "#cbd5e1" }}>
          <h3>Last result</h3>
          <pre style={{ whiteSpace: "pre-wrap" }}>{JSON.stringify(result, null, 2)}</pre>
        </div>
      )}
    </div>
  );
}
